import React from 'react';
import '../styles/LandingPage.css';

const LandingPage = () => {
    return (
        <div className="landing-page">
            <header className="landing-header">
                <h1>Mushroom Growth</h1>
                <p>Your journey into the world of mushrooms starts here!</p>
            </header>
            <main className="landing-content">
                <section className="introduction">
                    <h2>About Us</h2>
                    <p>We are dedicated to exploring the fascinating world of mushroom cultivation.</p>
                </section>
                <section className="features">
                    <h2>Features</h2>
                    <ul>
                        <li>Learn about different mushroom species</li>
                        <li>Get tips on cultivation techniques</li>
                        <li>Join our community of mushroom enthusiasts</li>
                    </ul>
                </section>
            </main>
            <footer className="landing-footer">
                <p>&copy; 2023 Mushroom Growth Project. All rights reserved.</p>
            </footer>
        </div>
    );
};

export default LandingPage;
